import React from "react";
import { useNavigate } from "react-router-dom";
import "../Css/Header.css"; // Ensure you have the correct path to your CSS file
// import profileImg from "./assets/profile.jpg"; // replace with actual image
import { FaFacebookF, FaTwitter, FaLinkedinIn, FaInstagram } from "react-icons/fa";

const Header = () => {
  const navigate = useNavigate();

  return (
    <div className="header-container">
      <div className="header-left">
        {/* <img src={} alt="Maya Nelson" className="profile-img" /> */}
        <h2>Maya <br /> Nelson</h2>
        <div className="underline"></div>
        <p className="title">Project Manager</p>
        <div className="social-icons">
          <FaFacebookF />
          <FaTwitter />
          <FaLinkedinIn />
          <FaInstagram />
        </div>
      </div>

      <div className="header-right">
        <h1>Hello</h1>
        <h3>Here's who I am & what I do</h3>
        <div className="header-buttons">
          <button className="filled-btn" onClick={() => navigate("/resume")}>Resume</button>
          <button className="outlined-btn" onClick={() => navigate("/projects")}>Projects</button>
        </div>
        <p>
          I'm a paragraph. Click here to add your own text and edit me. It’s easy. 
          Just click “Edit Text” or double click me to add your own content and 
          make changes to the font.
        </p>
        <p>
          I’m a great place for you to tell a story and let your users know 
          a little more about you.
        </p>
      </div>
    </div>
  );
};

export default Header;
